function App() {
  return (
      <Router>
        <div className="App">
          <Routes>

            <Route path="/signup" element={<Signup />} />
            <Route path="/otp" element={<OTPPage />} />

            <Route path="/error" element={<ErrorPage />} />
            <Route path="/error" element={<ErrorPage />} />


          </Routes>
        </div>
      </Router>
  );
}

export default App;
